import React from "react";
import "../App.css";

export default KeyVending = () => {
  return (
    <div className="KeyVending">
      <button>A</button>
      <button>B</button>
      <button>C</button>
      <button>1</button>
      <button>2</button>
      <button>3</button>
    </div>
  );
};
